import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './reception.css';

const ReceptionQueue = () => {
    const [receptionQueue, setReceptionQueue] = useState([]);
    const [searchTerm, setSearchTerm] = useState('');
    const [selectedPatient, setSelectedPatient] = useState(null);
    const [filteredData, setFilteredData] = useState(sampleData);


    // Fetch data from the API on component mount
    useEffect(() => {
        const apiUrl = 'http://localhost:3000/receptionQueue';

        axios
            .get(apiUrl)
            .then((response) => {
                setReceptionQueue(response.data);
            })
            .catch((error) => {
                console.error('Error fetching reception queue data:', error);
            });
    }, []);

    // Sample JSON data
    const sampleData = [
        {
            "uniqueNumber": "A2",
            "name": "אברהם שלום",
            "roomId": "12fhi23",
            "turnId": 2
        },
        {
            "uniqueNumber": "B1",
            "name": "מרים כהן",
            "roomId": "12fhi23",
            "turnId": 1
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 3
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 4
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 5
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 6
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 7
        }, {
            "uniqueNumber": "A2",
            "name": "אברהם שלום",
            "roomId": "12fhi23",
            "turnId": 8
        },
        {
            "uniqueNumber": "B1",
            "name": "מרים כהן",
            "roomId": "12fhi23",
            "turnId": 9
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 10
        }
    ];

    const handleSearch = () => {
        // Filter data based on the search term
        const result = receptionQueue.filter(
          (item) =>
            item.name.includes(searchTerm) || item.uniqueNumber.includes(searchTerm)
        );
    
        setFilteredData(result);
    
        // If there's exactly one result, set it as the selectedPatient
        if (result.length === 1) {
          setSelectedPatient(result[0]);
        } else {
          setSelectedPatient(null);
        }
      };


    const moveToHead = () => {
        console.log('Move to head:', selectedPatient);
    };

    return (
        <div>
            <h2>Reception Queue</h2>

            <div className="patientsTable">
                <table>
                    <thead>
                        <tr>
                            <th>שם מטופל</th>
                            <th>מספר</th>
                        </tr>
                    </thead>
                    <tbody>
                        {sampleData.map((item) => (
                            <tr key={item.turnId}>
                                <td>{item.name} </td>
                                <td>{item.uniqueNumber}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
            <div className="moveToHeadCont">
                <div>
                    <input
                        type="text"
                        placeholder="Search by name or number"
                        value={searchTerm}
                        onChange={(e) => setSearchTerm(e.target.value)}
                    />
                    <button onClick={handleSearch}>Search</button>
                </div>
                <select
                    value={selectedPatient ? `${selectedPatient.name} | ${selectedPatient.uniqueNumber}` : ''}
                    onChange={(e) => {
                        const [name, uniqueNumber] = e.target.value.split(' | ');
                        setSelectedPatient({ name, uniqueNumber });
                    }}
                >
                    {filteredData.map((item) => (
                        <option key={item.turnId}>
                            {item.name} | {item.uniqueNumber}
                        </option>
                    ))}
                </select>
                <button className="moveToHeadBtn" onClick={moveToHead}>
                    העבר לראש התור
                </button>
            </div>
        </div>
    );
};

export default ReceptionQueue;
